export default function User({details}){
    const [moreDetails, setMoreDetails] = useState([]);

    async function getDetails(){

        const response = await fetch(details);
        console.log(response.json());

    }
    return (
        <div>
            <h3>Details...</h3>
            <div>
                <a href={details} >Findout more...</a>
            </div>
        </div>
    );
}
